import React from 'react';
import NumberPresenter from './NumberPresenter';
import 'katex/dist/katex.min.css';
import { InlineMath, BlockMath } from 'react-katex';

const Test = () => {
  const input = [5, [-8, "/", 1, "/", 6, "/", 8]];

  const renderLatex = (latexString) => {
    // Remove the $$ delimiters
    const formula = latexString.slice(2, -2);
    return <BlockMath math={formula} />;
  };

  return (
    <div className="p-6">
      <h1 className="text-2xl font-bold mb-4">Test Page</h1>
      <NumberPresenter base={input[0]} exponentsAndOperators={input[1]} />
      <div className="mt-4">
        <h2 className="text-xl font-semibold mb-2">Rendered LaTeX:</h2>
        {renderLatex(new NumberPresenter({ base: input[0], exponentsAndOperators: input[1] }).generateLatexFormula())}
      </div>
    </div>
  );
};

export default Test;
